import { useState } from "react"
import axios from "axios";

export const NuevoUsuario=()=>{
    const [nombre,setNombre]=useState('');
    const [usuario,setUsuario]=useState('');
    const [password,setPassword]=useState('');

    /*function agregarUsuario(e) {
        e.preventDefault()
        var usuarioObj={
            nombre,
            usuario,
            password
        }
        console.log(usuarioObj)
        axios.post('http://localhost:4000/api/nuevoUsuario',usuarioObj).then((res)=>{
            console.log(res)
        }).catch((err)=>{
            console.log(err)
        })
    }*/

    async function agregarUsuario(e) {
        e.preventDefault()
        try {
            var usuarioObj={
                nombre,
                usuario,
                password
            }
            console.log(usuarioObj)
            const res = await axios.post('http://localhost:4000/api/nuevoUsuario',usuarioObj)
            console.log(res)
        } catch (error) {
            console.log(error)
        }

    }

    return <form onSubmit={agregarUsuario}>
        <div className="row">
            <div className="col-6 mb-3">
                <input type="text" placeholder="Nombre" className="form-control" value={nombre} onChange={(e)=>{setNombre(e.target.value)}}/>
            </div>
        </div>
        <div className="row">
            <div className="col-6 mb-3">
                <input type="text" placeholder="Usuario" className="form-control" value={usuario} onChange={(e)=>{setUsuario(e.target.value)}}/>
            </div>
        </div>
        <div className="row">
            <div className="col-6 mb-3">
                <input type="password" placeholder="Password" className="form-control" value={password} onChange={(e)=>{setPassword(e.target.value)}}/>
            </div>
        </div>
        <div className="row">
            <div className="col-6">
                <input type="submit" value='Enviar' className="btn btn-primary"/>
            </div>
        </div>
    </form>
}
